import React from 'react';
import './RegAccSumm.scss';

const RegAccSumm = (props) => {
    return(
        <div>
            <div className="RegNavPanel">
                <button onClick={props.prev}>COFNIJ</button>
                <button onClick={props.next}>DALEJ</button>
            </div>
        </div>
    )
}

export default RegAccSumm;
